import React, {Component} from 'react'
import logo from './images/logo'


export default class Header extends Component{
    constructor(...props){
        super(...props)

        this.state={
            logedIn: false
        }
    }

    render(){
        return(
            <div>
                <div className="row">
                    <div className="col-md-2">
                        <img src={logo} alt=""/>
                    </div>
                </div>
            </div>
        )
    }
}
